description:
[ 위치 / 교통편 ]


@ 논현역 신논현역 학동역 도보가능한 위치에있습니다.

@ 주택가에 위치해있어 조용하게 이용하시기 좋아요

@ 큰길가 근처로 대중교통및 자차이용시 편리합니다

@ 버스정류장까지 1분 지하철역까지 5분 위치 매우좋습니다.

   [ 시설 / 구조 및 특징 ]


@ 최고급 옵션이 비치되어 있습니다

@ 느낌있는 인테리어로 세련미 뿡쁭

@작지않은 공간으로 공간을 넓게 이용하시기 좋아요

@인테리어 아주아주 고급지게 잘되어있습니다.

@배란다 공간이 있어 여유공간으로 이용하시기 좋아요

@3개월 기본계약(1~2개월 별도협의)
21.10.25에 직방에 등록된 매물입니다.

@이 방은 신축4년된 빌라형 다가구 주택입니다
@옵션이 있구요(냉장고.세탁기. 에어컨 등등)
@현재 공실이구요
@전세자금대출 가능합니다
@모자란 금액은 월세도 가능합니다
21.10.27에 직방에 등록된 매물입니다.

